import Gallery from './Galerry';
import img1 from './Cerestia/1.png';
import img2 from './Cerestia/2.png';
import img3 from './Cerestia/3.png';
import img4 from './Cerestia/4.png';
import img5 from './Cerestia/5.png';
import img6 from './Cerestia/6.png';
import img7 from './Cerestia/7.png';
import img8 from './Cerestia/8.png';

function App() {

  let data=[
      {imgSrc: img1},
      {imgSrc: img2},
      {imgSrc: img3},
      {imgSrc: img4},
      {imgSrc: img5},
      {imgSrc: img6},
      {imgSrc: img7},
      {imgSrc: img8},
  ]

  return (
    <>
      <h1 style={{textAlign:'center'}}>Image Gallery</h1>
      <Gallery data={data}/>
    </>
  );
}

export default App;
